function calculateStandardDeviation(array) {
    //known as stdev in tradingview
    const n = array.length
    const mean = array.reduce((a, b) => a + b) / n
    const StandDev = Math.sqrt(array.map(x => Math.pow(x - mean, 2)).reduce((a, b) => a + b) / n)
    return StandDev
}


