function calculateWMA(prices, periods) {
    let pLen = prices.length;   // calculate once for speed.

    // Check we have enough values to make calculation:
    if (pLen < periods) { return 0; }

    let count = 1;
    let numerator = 0;
    for (let i = pLen - periods; i < pLen; i++, count++) {
        numerator += prices[i] * count;
    }
    let value = numerator / ((periods * (periods + 1)) / 2)

    return (value)
}

